import React from 'react';
import FeedCard from './FeedCard';

const FEED_COLUMNS = [
  { key: 'new', label: 'newly created' },
  { key: 'graduating', label: 'about to graduate' },
  { key: 'graduated', label: 'graduated' },
  { key: 'featured', label: 'featured' },
];

// Mock data for each column
const MOCK_FEEDS = {
  new: [
    {
      icon: 'üß¢', name: 'FEDORACOIN', subtitle: 'The First Memecoin', roi: '+28%', holders: 0, dh: '0%', t10: '0%', mc: '$4.1K', ath: '$4.1K', vol: '$4.1K',
    },
    {
      icon: 'üì±', name: 'MOBILE', subtitle: 'Motorola DynaTAC 8000X', roi: '+13%', holders: 0, dh: '0%', t10: '0%', mc: '$4.1K', ath: '$4.1K', vol: '$4.1K',
    },
    {
      icon: 'üí©', name: 'SOTUS', subtitle: 'Shitter Of The United States', roi: '+14%', holders: 0, dh: '0%', t10: '0%', mc: '$4.1K', ath: '$4.1K', vol: '$4.1K',
    },
  ],
  graduating: [
    {
      icon: 'üè≥Ô∏è‚Äçüåà', name: 'GAY', subtitle: 'Gay Nigga Season', roi: '-4%', holders: 35, dh: '10%', t10: '19%', mc: '$41.6K', ath: '$44.5K', vol: '$6.4K',
    },
    {
      icon: 'üá∫üá∏', name: 'USCR', subtitle: 'U.S. Crypto Reserve Index', roi: '+3%', holders: 27, dh: '72%', t10: '73%', mc: '$42.8K', ath: '$42.7K', vol: '$12.4K',
    },
    {
      icon: 'üßë‚Äç‚öñÔ∏è', name: 'pope fong', subtitle: 'pope fong', roi: '+116%', holders: 84, dh: '4%', t10: '26%', mc: '$41.6K', ath: '$41.6K', vol: '$10.1K',
    },
  ],
  graduated: [
    {
      icon: 'üüß', name: 'FEDORA', subtitle: 'The First Memecoin', roi: '+2.2K%', holders: 309, dh: '40%', t10: '10%', mc: '$60.2K', ath: '$60.2K', vol: '$161.5K',
    },
    {
      icon: 'üßë‚Äçüé®', name: 'stickman', subtitle: 'stickman', roi: '+49%', holders: 122, dh: '26%', t10: '26%', mc: '$28.4K', ath: '$32.4K', vol: '$49.4K',
    },
    {
      icon: 'üß†', name: 'GENIUS', subtitle: 'Genius AI', roi: '+4.7%', holders: 6, dh: '3%', t10: '3%', mc: '$2.4K', ath: '$2.4K', vol: '$2.4K',
    },
  ],
  featured: [
    {
      icon: 'üê±', name: 'CKV', subtitle: 'Crypto KittyVerse', roi: '+10%', holders: 2, dh: '7%', t10: '5%', mc: '$4.5K', ath: '$5.5K', vol: '$2.0K',
    },
    {
      icon: 'ü¶∏‚Äç‚ôÇÔ∏è', name: 'SUS', subtitle: 'Super Ultra Sendor', roi: '+513%', holders: 5, dh: '-9%', t10: '22%', mc: '$14.4K', ath: '$27.2K', vol: '$58.3K',
    },
    {
      icon: 'üå∏', name: 'MURAKAMI', subtitle: 'MURAKAMI', roi: '+3%', holders: 9, dh: '0.39%', t10: '7%', mc: '$4.3K', ath: '$4.7K', vol: '$419',
    },
  ],
};

export default function FeedGrid() {
  return (
    <div className="w-full min-h-screen bg-gradient-to-br from-zinc-900 via-black to-zinc-950 px-4 py-8">
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 max-w-full">
        {FEED_COLUMNS.map((col) => (
          <section key={col.key} className="flex flex-col bg-zinc-900/70 rounded-2xl border border-zinc-800 shadow-xl backdrop-blur-xl min-h-[80vh]">
            {/* Sticky Header */}
            <header className="sticky top-0 z-10 bg-zinc-900/80 backdrop-blur border-b border-zinc-800 rounded-t-2xl flex items-center justify-between px-4 py-3">
              <div className="flex items-center gap-2">
                <span className="text-green-400 text-lg font-bold">‚Ä¢</span>
                <span className="text-lg font-semibold text-white capitalize">{col.label}</span>
                <button className="ml-2 text-xs text-zinc-400 hover:text-green-400 transition">[filter]</button>
              </div>
              <button className="ml-2 p-1 rounded-full bg-zinc-800 hover:bg-green-900/30 transition">
                <svg width="18" height="18" fill="none" viewBox="0 0 24 24" className="text-green-400"><rect x="5" y="11" width="14" height="2" rx="1" fill="currentColor"/></svg>
              </button>
            </header>
            {/* Cards */}
            <div className="flex-1 p-4 space-y-4">
              {MOCK_FEEDS[col.key].map((item, idx) => (
                <FeedCard key={item.name + idx} {...item} />
              ))}
            </div>
          </section>
        ))}
      </div>
    </div>
  );
}
